    /**
     * 客户端加载完毕(可以刷地图了)
     */
    @IoThread
    @ActionMethod(CCmd.CLIENT_READY)
    public void clientReady(FlowContextEx flowContext) {
        log.info("客户端加载完毕: playerId={}", flowContext.getRoleId());
        long userId = flowContext.getUserId();
        long roleId = flowContext.getRoleId();

        flowContext.fire(new ClientReadyEvent(userId, roleId));

        // 运营活动信息
        updateActivityInfoNtf(flowContext);
        get_mst_weekly_activity_info(flowContext);
        GET_MST_REPEL_EVIL_INFO_NTF(flowContext);
        RANK_ACTIVITY_INFO_NTF(flowContext);
        RANK_ACTIVITY_REWARD_INFO_NTF(flowContext);
        NEW_SERVER_GOAL_TABLE_NTF(flowContext);
        BATTLE_PLAN_GET_LIST(flowContext);
        GET_RECHARGE_GIFT_ACT_INFO_NTF(flowContext);
        RECHARGE_GIFT_ACT_RECORD_NTF(flowContext);
        GET_MST_COMMENT_REWARD_INFO_NTF(flowContext);
        IOS_COMMENT_NTF(flowContext);
        GET_MST_LIMIT_TIME_GFIT_INFO_NTF(flowContext);
        GET_MST_GIFT_PACK_INFO_NTF(flowContext);
        GET_MST_GIFT_INFO_NTF(flowContext);
        GET_MST_SPEND_RESERVE_INFO_NTF(flowContext);
        SPEND_RESERVE_INIT_NTF(flowContext);
        MST_BATTLE_PASS_INFO_NTF(flowContext);
        BATTLE_PASS_INIT_NTF(flowContext);
        NEW_GET_RECHARGE_GIFT_ACT_INFO_NTF(flowContext);
        NEW_RECHARGE_GIFT_ACT_RECORD_NTF(flowContext);
        GET_MST_SEASON_INFO_NTF(flowContext);
        SERVER_AVERAGE_LEVEL_CHANGE_NTF(flowContext);
        GET_ACTIVITY_INFO_NTF(flowContext);
        SERVER_NUM_NTF(flowContext);

        // 世界boss 入口信息
        world_boss_entry_list(flowContext);
        world_boss_init_list(flowContext);
        PERSONAL_EVENT_LIST_NTF(flowContext);
        COMPLETE_DUPLICATE_DATA_NTF(flowContext);
        CHAPTER_DATA_NTF(flowContext);
        NEW_SERVER_TASK_INFO_NTF(flowContext);
        MAGIC_FIRE_LOTTERY_ITEM_NTF(flowContext);
        ENTER_GRID_MAP_INIT_NTF(flowContext);

        // 各个地图各个时间段的天气信息
        sys_weather_data_ntf(flowContext);
        skill_list(flowContext);
        get_task_list_ntf(flowContext);
        update_globe_param(flowContext);
        novice_guide_record_ntf(flowContext);
        HEALTH_TIME_NTF(flowContext);
        daily_use_ntf(flowContext);
        FINISHED_ASSEMBLY_LIST_INIT_NTF(flowContext);
        innat_start_ntf(flowContext);
        received_task_list_ntf(flowContext);
        fog_unlock_data_ntf(flowContext);
        server_version(flowContext);

        otherPush(flowContext);

        // 功能开启
        unlockControlInfoNtf(flowContext);

        // 数据推送完毕
        flowContext.broadcastMe(SCmd.DATA_SEND_FINISH);

        // 服务器数据推送完毕 结束推送
        flowContext.broadcastMe(SCmd.SEVER_PUSH_END);

        // 加入到世界
        BigScreenExchange.joinRoleScreen(flowContext, 1000);
    }

